import React from 'react';
import PropTypes from 'prop-types';
import Markdown from 'markdown-to-jsx';
import dayjs from 'dayjs';

const Splits = ({ data }) => (
    //   name: 
    //   position: 
    //   companyProfile:
    //   startDate: 
    //   endDate: 
    //   summary: 
    //   techStack
    <article className="Split-container">
        <div>
            <header>
                <h4>{data.title}</h4>
                <p>{data.eplaination}</p>
            </header>
            <ul className="points">
                {Object.entries(data.split).map(([exercise, link]) => (
                <li key={exercise}>
                <a href={link} target="_blank" rel="noopener noreferrer">
                    {exercise}
                </a>
                </li>
                ))}
            </ul>
        </div>
        <div>
            <img src={data.pic}/>
        </div>
    </article>
);

const SplitsSta = ({ data }) => (
    <div className="splitSta">
        <div className="link-to" id="split" />
            <div className="title">
                <h3>Current Split</h3>
            </div>
            {data.map((job, index) => (
            <Splits
                data={job}
                key={job.title}
                isImageLeft={index % 2 === 0}
            />
            ))}

    </div>
);

SplitsSta.propTypes = {
    data: PropTypes.arrayOf(PropTypes.shape({
        name: PropTypes.string,
        position: PropTypes.string,
        companyProfile: PropTypes.string,
        startDate: PropTypes.string,
        endDate: PropTypes.string,
        summary: PropTypes.arrayOf(PropTypes.string),
    })),
};

Splits.propTypes = {
    data: PropTypes.shape({
        name: PropTypes.string.isRequired,
        position: PropTypes.string.isRequired,
        companyProfile: PropTypes.string.isRequired,
        startDate: PropTypes.string.isRequired,
        endDate: PropTypes.string.isRequired,
        summary: PropTypes.arrayOf(PropTypes.string.isRequired),
    }).isRequired,
};

export default SplitsSta;
